INSERT INTO `dynamic_faqsinmobiliarias` VALUES (1,'es','Es muy sencillo',1,'<p>Para registrar su ag&eacute;ncia inmobiliaria con nosotros lo &uacute;nico que debe de hacer es env&iacute;arnos un email a la direcci&oacute;n <a href=\"info@pisosenmanresa.com\">info@pisosenmanresa.com</a></p>\r\n','Es muy sencillo','','es-muy-sencillo','Es muy sencillo','Es muy sencillo','INDEX,FOLLOW','','','ACTIVED',0),(2,'es','Descubra lo que le podémos aportar',2,'<p>Gracias a nuestro portal su inmobilaria podr&aacute; obtener los siguientes beneficios:</p>\r\n\r\n<p>01.- Consulta sobre propiedades de clientes</p>\r\n\r\n<p>02.- Consulta sobre propiedades de otras inmobiliarias</p>\r\n\r\n<p>03.- Consultas de agentes inmobiliarios</p>\r\n\r\n<p>&nbsp;</p>\r\n','Descubra lo que le podémos aportar','','descubra-lo-que-le-podemos-aportar','Descubra lo que le podémos aportar','Descubra lo que le podémos aportar','INDEX,FOLLOW','','','ACTIVED',0),(3,'es','Tenemos muchos métodos para que suban sus inmuebles',3,'En <a target=\"_blank\" href=\"https://www.pisosenmanresa.com\">PisosenManrea</a> tenemos muchos métodos de subir inmuebles, a continuación les mostramos alguno de ellos:\r\n01.- Subida manual de inmuebles con el rellenado de las fichas de inmueble e imagénes\r\n02.- Subida con fichero ilimitado de propiedades\r\n03.- Gestión de cron actualizada diária.\r\n04.- Automatización de su sistema si es un sistema estándar','Tenemos muchos métodos para que suban sus inmuebles','','tenemos-muchos-metodos-para-que-suban-sus-inmuebles','Tenemos muchos métodos para que suban sus inmuebles','Tenemos muchos métodos para que suban sus inmuebles','INDEX,FOLLOW','','','ACTIVED',0);
