sManresa: Juntos marcamos la diferencia','<p>Nuestra prioridad es ofrecer a nuestros clientes el piso , casa , villa ideal para su vida en Manresa. Estamos en continuo crecimiento y mejor&iacute;a y ofrecemos cada a&ntilde;o novedades para permitirle a Usted y sus familiares disfrutar de una vivienda &uacute;nica.</p>\r\n\r\n<p>La confianza de nuestros clientes es nuestra m&aacute;xima aspiraci&oacute;n. Nuestro compromiso es darle un tiempo de ensue&ntilde;o en Manresa.</p>\r\n\r\n<p>Cada a&ntilde;o es diferente y &eacute;ste ser&aacute; el mejor de todos. Denos su confianza y le daremos lo mejor de nosotros.</p>\r\n\r\n<p>Esto es pisosnmanresa, personas al servicio de las personas, profesionales bien preparados, con experiencia y formaci&oacute;n suficiente para ofrecerle un servicio de alta calidad y m&aacute;xima efectividad a la hora de vender o comprar su vivienda. M&aacute;s de 30 a&ntilde;os de trayectoria empresarial ininterrumpida, una importante red de oficinas en progresivo crecimiento en las principales ciudades del pa&iacute;s y un volumen de negocio que nos ha llevado a intermediar propiedades por valor de m&aacute;s de 500.000.000 de euros en el &uacute;ltimo ejercicio, posicion&aacute;ndonos como la red inmobiliaria m&aacute;s importante del pa&iacute;s, con mayor volumen de ventas y con los mejores &iacute;ndices de satisfaci&oacute;n.</p>\r\n\r\n<p>Hemos conseguido arraigar en nuestros profesionales la filosof&iacute;a b&aacute;sica que ha marcado nuestra historia desde sus or&iacute;genes: el respeto hacia nuestros clientes, la seriedad y honradez en nuestras actividades y la voluntad y el compromiso de servir eficazmente.</p>\r\n\r\n<p>Las credenciales de pisosmanresa son los miles de clientes que han vendido, comprado o alquilado su vivienda con nosotros de manera satisfactoria; este es nuestro mejor aval.</p>\r\n\r\n<p>Esta es nuestra fuerza.</p>\r\n','','','','<ul>\r\n	<li>100% PisosManresa - Gestionamos en exclusiva todos nuestros alojamientos. Lo que nos permite garantizar la calidad.</li>\r\n	<li>Una amplia oferta de alojamientos en Manresa - Gestionamos m&aacute;s de 1000 propiedades. Encontraremos la casa o apartamento &quot;perfecto&quot; para su familia.</li>\r\n	<li>Un equipo profesional y multiling&uuml;e trabajando para su familia. Un equipo especializado en atenci&oacute;n al cliente, volcado en la personalizaci&oacute;n de su estancia.</li>\r\n	<li>Queremos ser sus anfitriones y los de su familia. Para nosotros es un placer poderles ense&ntilde;ar uno de los lugares m&aacute;s sorprendentes del mundo: Manresa.</li>\r\n</ul>\r\n','Servicios ofrecidos','','','<ul>\r\n	<li>Alquiler de apartamentos, estudios, casas y villas en r&eacute;gimen de Self Catering en Manresa. Nuestra &aacute;rea de trabajo se sit&uacute;a sobre todo en las localidades Artes, Avinyo , Callus , Castellbell i el Vilar , Castellgali , Castellnou de Bages , El Pont de Vilomara i Rocafort , Fonollosa</li>\r\n	<li>Compra-venta de propiedades en Manresa.</li>\r\n	<li>Disponemos de un servicio profesional de limpieza, mantenimiento, jardiner&iacute;a y limpieza de piscinas.</li>\r\n	<li>Excursiones guiadas a los principales puntos de inter&eacute;s de Manresa.</li>\r\n	<li>Entradas a parques tem&aacute;ticos como Port Aventura y Aquopolis,...</li>\r\n</ul>\r\n','','','','','','<p>0</p>\r\n','Sobre nosotros en Pisos en Manresa | Casas en Manresa | PisosEnManresa.com','sobre-nosotros','sobre-nosotros','Nosotros en manresa somos una compañía cuya finalidad es la de impulsar el sector inmobiliario y de turístico de manresa','Nosotros esperámos así poder apoyar al sector inmobiliario, inmobiliarias, sector turístico en manresa','INDEX,FOLLOW','','','ACTIVED',0),(8,'es','Propietarios','Faq Propietarios','Propietarios pisos , casas , villas en Manresa','29','Propietarios',NULL,'','','',NULL,'','','','','','','','','','','Propietarios en Pisos en Manresa | Casas en Manresa | PisosEnManresa.com','propietarios','faq-propietarios','propi